import { createRouter, createWebHistory } from 'vue-router';
import UserLogin from '@/views/UserLogin.vue';
import UserRegisto from '@/views/UserRegisto.vue';
import PaginaInicial from '@/views/PaginaInicial.vue';
import PaginaUtilizador from '@/views/PaginaUtilizador.vue';
import AdicionarFoto from '@/views/AdicionarFoto.vue';
import DefinicoesUtilizador from '@/views/DefinicoesUtilizador.vue';
import AlterarEmail from '@/views/AlterarEmail.vue';
import AlterarPassword from '@/views/AlterarPassword.vue';
import AlterarNome from '@/views/AlterarNome.vue';



const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes: [
    {
      path: '/login',
      name: 'UserLogin',
      component: UserLogin
    },
    {
      path: '/registo',
      name: 'UserRegisto',
      component: UserRegisto
    },
    {
      path: '/paginainicial',
      name: 'PaginaInicial',
      component: PaginaInicial
    },

    {
      path: '/paginautilizador',
      name: 'PaginaUtilizador',
      component: PaginaUtilizador
    },
    {
      path: '/adicionarfoto',
      name: 'AdicionarFoto',
      component: AdicionarFoto
    },
    {
      path: '/definicoes',
      name: 'DefinicoesUtilizador',
      component: DefinicoesUtilizador
    },
    {
      path: '/alteraremail',
      name: 'AlterarEmail',
      component: AlterarEmail
    },
    {
      path: '/alterarpassword',
      name: 'AlterarPassword',
      component: AlterarPassword
    },
    {
      path: '/alterarnome',
      name: 'AlterarNome',
      component: AlterarNome
    },
    // ... outras rotas
  ],
});

export default router;
